import logo from './logo.svg';
import './App.css';

import {
  ApolloClient,
  InMemoryCache,
  ApolloProvider,
  useQuery,
  gql
} from "@apollo/client";
const client = new ApolloClient({
    uri: 'https://48p1r2roz4.sse.codesandbox.io',
  cache: new InMemoryCache()
});
// const client = ...

client
  .query({
    query: gql`
      query GetRates {
        rates(currency: "USD") {
          currency
        }
      }
    `
  })
  .then(result => console.log(result));

function App() {
  return (
    <div className="App">React App</div>
  );
}

export default App;
